INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 0, "2020/04/30 12:00:00", 1, 0.0, "あたしだって\nやるときはやるよ！", 102601, 10040, 24001, 1, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 1, "2020/04/30 12:00:00", 1, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", 102601, 10040, 24002, 1, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 2, "2020/04/30 12:00:00", 1, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", 102601, 10040, 24003, 1, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 3, "2020/04/30 12:00:00", 2, 0.0, "やったね！\nこれでようやく\nサボれるよ…", 102601, 10040, 24004, 2, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 4, "2020/04/30 12:00:00", 1, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 102601, 10040, 24005, 1, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 5, "2020/04/30 12:00:00", 2, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 102601, 10040, 24006, 2, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 6, "2020/04/30 12:00:00", 2, 0.0, "あたしも意外と\nやるもんでしょ？", 102601, 10040, 24007, 2, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 7, "2020/04/30 12:00:00", 4, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 102601, 10040, 24008, 4, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 8, "2020/04/30 12:00:00", 4, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", 102601, 10040, 24009, 4, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 9, "2020/04/30 12:00:00", 4, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", 102601, 10040, 24010, 4, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 10, "2020/04/30 12:00:00", 4, 0.0, "やられた…\nねずみって意外と\nてごわいね", 102601, 10040, 24011, 4, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 11, "2020/04/30 12:00:00", 4, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", 102601, 10040, 24012, 4, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (24, 12, "2020/04/30 12:00:00", 4, 1.81, "疲れた…\nけど、次こそは\n守り抜くよ…", 102601, 10040, 24013, 1, 0.0, "2030/12/17 14:59:59", "リン", 0.0);
